public class AcademyIsConveyableShipment implements YCPDynamicCondition{
	private static final YFCLogCategory log = YFCLogCategory.instance(AcademyIsConveyableShipment.class);
	private Properties props;	
	   public void setProperties(Properties props) {
	        this.props = props;
	    }
	public boolean evaluateCondition(YFSEnvironment env, String sName,
			Map mapData, String sXMLData) {
		log.beginTimer(" Begining of AcademyIsConveyableShipment -> evaluateCondition Api");
		
		YFCDocument inXml = YFCDocument.getDocumentFor(sXMLData);
		if(!YFCObject.isVoid(inXml)){
			Document inDoc = inXml.getDocument();
			Element einElem = inDoc.getDocumentElement();
			String strShipmentType = "";
			if(!YFCObject.isVoid(einElem)){
				Element eShipElem = (Element) einElem.getElementsByTagName("Shipment").item(0);
				if(!YFCObject.isVoid(eShipElem)){
					strShipmentType = eShipElem.getAttribute("ShipmentType");
				} 
				//Start:Changes made for STL-934 Checkout Funnel
				//Start:Changes made for STL-1320 Checkout Funnel OVNT
				
				//Start Start WN-214, WN-216, WN-217, WN-211, WN-419 Hazmat Implementation 
				if(strShipmentType.equals("CON") || strShipmentType.equals("CONOVNT") || strShipmentType.equals("GC") ||
						strShipmentType.equals(AcademyConstants.STR_GC_ONLY_SHIP_TYPE) || strShipmentType.equals(AcademyConstants.AMMO_SHIPMENT_TYPE)|| 
						AcademyConstants.HAZMAT_SHIPMENT_TYPE.equals(strShipmentType) ||
						strShipmentType.equals(AcademyConstants.ATTR_CSA_SHIPMENT_TYPE) || strShipmentType.equals(AcademyConstants.ATTR_CSA_OVNT_SHIPMENT_TYPE))
					//End Start WN-214, WN-216, WN-217, WN-211, WN-419 Hazmat Implementation 
					
                      //End : Changes made for STL-1320 Checkout Funnel OVNT
					//End:Changes made for STL-934 Checkout Funnel
				{ 
					log.verbose("Conveyable Shipment");
					return true;
				}else{
					log.verbose("Bulk Shipment");
					return false;
				}
			}
				
		}		
		log.endTimer(" Ending of AcademyIsConveyableShipment -> evaluateCondition Api");
		return true;
	}
}


